    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1607985386518,"commentText":"<font face=\"Courier\">int</font> and <font face=\"Courier\">float</font> are numeric data types. They are used for programming with numbers. Almost everything we do in a program involves numbers. <br><br>Don't worry if you do not consider yourself a mathematician (I certainly don't). The computer can really only add, subtract, multiply, and divide numbers. You have been doing those things for a long time so you are ready to become a programmer.<br><br>A data type defines a few things:<br>- the operations that can be performed on variables of that type<br>- the values that can be stored inside a variable of that type (there is usually a range of acceptable values)<br>- the amount of space a variable takes up in memory<br><br>This program will create some numeric variables and I will discuss the types as we go.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-174":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-174","timestamp":1503776187878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":174,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-173","lineNumber":11,"column":25,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609181629343,"commentText":"The <font face=\"Courier\">int</font> type is used for integers. The mathematical operations that can be performed are pretty straightforward: addition (+), subtraction (-), multiplication (*), and division (/ and %).<div><br></div><div>Only division requires some explanation. The division of integers is the only operation that can cause a result with a fractional part. Fractional parts are not allowed in integers.<br></div><div><br></div><div>Here I am dividing the values of two variables and storing the result in another integer variable. As you can see from the attached picture 12/2 is equal to 6, of course.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result = num1 / num2;","startRow":10,"startColumn":4,"endRow":10,"endColumn":25}],"imageURLs":["media/images/1607985440180-01.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"2","currentFilePath":"/numbers.cpp","viewableBlogText":"int main() \n{ \n    int num1 = 12; \n    int num2 = 2; \n    int result; \n \n    result = num1 / num2; \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-237":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-237","timestamp":1503776212852,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":237,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-236","lineNumber":16,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609181710197,"commentText":"<div>However, if I change the value of the numerator and divide again I get the exact same result, 6. Integer 13 divided by integer 2 is equal to 6 not 6.5. The attached picture shows the variables at the end of the program.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"num1 = 13; \n    result = num1 / num2;","startRow":12,"startColumn":4,"endRow":13,"endColumn":25}],"imageURLs":["media/images/1607985730063-02.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"8","linesBelow":"3","currentFilePath":"/numbers.cpp","viewableBlogText":"int main() \n{ \n    int num1 = 12; \n    int num2 = 2; \n    int result; \n \n    result = num1 / num2; \n \n    num1 = 13; \n    result = num1 / num2; \n \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-3","displayCommentEvent":{"id":"ev-237","timestamp":1503776212852,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":237,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-236","lineNumber":16,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609181777382,"commentText":"The reason is that integer division returns the quotient which is always an integer (see the attached picture). This is true of all integer divides using the <font face=\"Courier\">/</font> operator.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"num1 = 13; \n    result = num1 / num2;","startRow":12,"startColumn":4,"endRow":13,"endColumn":25}],"imageURLs":["media/images/1607985862153-03.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"8","linesBelow":"3","currentFilePath":"/numbers.cpp","viewableBlogText":"int main() \n{ \n    int num1 = 12; \n    int num2 = 2; \n    int result; \n \n    result = num1 / num2; \n \n    num1 = 13; \n    result = num1 / num2; \n \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-280":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-280","timestamp":1503776226931,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":280,"type":"INSERT","fileId":"fileId-0","character":"%","previousNeighborId":"ev-265","lineNumber":16,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609181810525,"commentText":"There is another integer division operator called the modulus operator that returns the remainder. The mod operator is the <font face=\"Courier\">%</font> symbol. The result in this case is 1 (see the attached pictures).","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result = num1 % num2;","startRow":15,"startColumn":4,"endRow":15,"endColumn":25}],"imageURLs":["media/images/1607985996240-05.jpeg","media/images/1607985996240-04.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"11","linesBelow":"3","currentFilePath":"/numbers.cpp","viewableBlogText":"int main() \n{ \n    int num1 = 12; \n    int num2 = 2; \n    int result; \n \n    result = num1 / num2; \n \n    num1 = 13; \n \n    result = num1 / num2; \n    result = num1 % num2; \n     \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-5","displayCommentEvent":{"id":"ev-280","timestamp":1503776226931,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":280,"type":"INSERT","fileId":"fileId-0","character":"%","previousNeighborId":"ev-265","lineNumber":16,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609182712344,"commentText":"Believe it or not the mod operator comes in handy all the time in programming. We'll see some examples later on.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"%","startRow":15,"startColumn":18,"endRow":15,"endColumn":19}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result = num1 % num2; ","commentTags":[],"questionCommentData":{"allAnswers":["3.28, .72, 1, 0, 0, 1","3, 2, 1, 0, 0, 0","3, 2, 1, 1, 0, 8","3, 3, 1, 0, 0, 1"],"correctAnswer":"3, 2, 1, 0, 0, 0","question":"What are the results of these divisions/mods? (23 / 7), (23 % 7), (8 / 8), (8 % 8), (0 / 8), (0 % 8)"}}],"ev-412":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-412","timestamp":1503776407280,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":412,"type":"INSERT","fileId":"fileId-0","character":"<","previousNeighborId":"ev-411","lineNumber":20,"column":65,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1607986355584,"commentText":"A data type also specifies an acceptable range of values. An <font face=\"Courier\">int</font> variable cannot hold an infinite sized number, there is a limit.<div><br></div><div>There is a built in constant called <font face=\"Courier\">INT_MAX</font> that holds the largest value that can be stored in any <font face=\"Courier\">int</font> variable (there is an <font face=\"Courier\">INT_MIN</font> too).</div><div><br></div><div>Lets store that value inside result and then print it. You can see the value 2,147,483,647 in the attached picture.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result = INT_MAX;","startRow":17,"startColumn":4,"endRow":17,"endColumn":21},{"fileId":"fileId-0","selectedText":"cout<<\"The largest value that can be stored in an int is: \"<<result<<endl;","startRow":19,"startColumn":4,"endRow":19,"endColumn":78}],"imageURLs":["media/images/1607986201425-Screen Shot 2020-12-14 at 4.49.37 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"13","linesBelow":"3","currentFilePath":"/numbers.cpp","viewableBlogText":"int main() \n{ \n    int num1 = 12; \n    int num2 = 2; \n    int result; \n \n    result = num1 / num2; \n \n    num1 = 13; \n \n    result = num1 / num2; \n    result = num1 % num2; \n  \n    result = INT_MAX; \n \n    cout<<\"The largest value that can be stored in an int is: \"<<result<<endl; \n     \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-416":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-416","timestamp":1503776480351,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":416,"type":"INSERT","fileId":"fileId-0","character":"1","previousNeighborId":"ev-415","lineNumber":18,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609182007772,"commentText":"Depending on what types of calculations you are doing, you may never come close to exceeding the maximum value for an <font face=\"Courier\">int</font>.<div><br></div><div>However, it is a real maximum limit. If I attempt to add 1 to the max and run the program again I will get some strange output. <br></div><div><br></div><div>In the attached screenshot you can see what happened when I added one to INT_MAX. The result is a negative number, -2,147,483,648.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result = INT_MAX + 1;","startRow":17,"startColumn":4,"endRow":17,"endColumn":25},{"fileId":"fileId-0","selectedText":"cout<<\"The largest value that can be stored in an int is: \"<<result<<endl;","startRow":19,"startColumn":4,"endRow":19,"endColumn":78}],"imageURLs":["media/images/1607986484661-Screen Shot 2020-12-14 at 4.54.13 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result = INT_MAX + 1; \n \n    cout<<\"The largest value that can be stored in an int is: \"<<result<<endl; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-8","displayCommentEvent":{"id":"ev-416","timestamp":1503776480351,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":416,"type":"INSERT","fileId":"fileId-0","character":"1","previousNeighborId":"ev-415","lineNumber":18,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609182033458,"commentText":"Adding one to a large positive number results in a negative number. Strange...<div><br></div><div>There is a good reason for this, though. The range of values can be thought of as living on a number line.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"INT_MAX + 1","startRow":17,"startColumn":13,"endRow":17,"endColumn":24}],"imageURLs":["media/images/1607986633264-06.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result = INT_MAX + 1; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-9","displayCommentEvent":{"id":"ev-416","timestamp":1503776480351,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":416,"type":"INSERT","fileId":"fileId-0","character":"1","previousNeighborId":"ev-415","lineNumber":18,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609182936508,"commentText":"<div>The regular rules of arithmetic apply except when you get to the end of the number line. When you perform an operation that causes the result to go beyond either end you get an <i>overflow</i>.</div><div><br></div><div>Think of the number line as a circle instead of a line. It wraps around to itself. Going beyond the end wraps around into the negative number range.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"INT_MAX + 1","startRow":17,"startColumn":13,"endRow":17,"endColumn":24}],"imageURLs":["media/images/1607986677716-07.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result = INT_MAX + 1; ","commentTags":[],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"True","question":"True or false, it is appropriate to use an int for variables that hold someone's age, years since they graduated high school, and number of siblings?"}},{"id":"commentId-10","displayCommentEvent":{"id":"ev-416","timestamp":1503776480351,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":416,"type":"INSERT","fileId":"fileId-0","character":"1","previousNeighborId":"ev-415","lineNumber":18,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1607987001240,"commentText":"Data types have limits to the values they can store because each variable takes up a certain amount of space in memory.<br><br>An <font face=\"Courier\">int</font> variable requires 32 bits of space. Because this is a finite amount of memory space for bits (1's and 0's) it can only hold a finite range of values.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"INT_MAX + 1","startRow":17,"startColumn":13,"endRow":17,"endColumn":24}],"imageURLs":["media/images/1607986975098-08.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result = INT_MAX + 1; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-493":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-493","timestamp":1503779510918,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":493,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-492","lineNumber":25,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609182242540,"commentText":"<div>I'll add a few more variables. I'll create some <font face=\"Courier\">floats</font> this time. <br></div><div><br></div><div>With sequential flow, I can declare variables at any point in the program. However, one can only use a variable <b><i>after </i></b>the point where it was declared. The program runs from top to bottom so a declaration has to come before the first use of a variable.</div><div><div><br></div><div>The following code would be a syntax error because the order of these two statements is reversed:</div><div><br></div><div><font face=\"Courier\">x = 10; //error here</font></div><div><font face=\"Courier\">int x;</font></div></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float num3 = 12.0; \n    float num4 = 2.0; \n    float result2;","startRow":21,"startColumn":4,"endRow":23,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    float num3 = 12.0; \n    float num4 = 2.0; \n    float result2; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-12","displayCommentEvent":{"id":"ev-493","timestamp":1503779510918,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":493,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-492","lineNumber":25,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609183066825,"commentText":"The way to tell the compiler to use a <font face=\"Courier\">float</font> value instead of an <font face=\"Courier\">int</font> is to always use a decimal point when specifying <font face=\"Courier\">float</font> values. The highlighted code says I am interested in using the <font face=\"Courier\">float</font> values 12.0 and 2.0.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"12.0","startRow":21,"startColumn":17,"endRow":21,"endColumn":21},{"fileId":"fileId-0","selectedText":"2.0","startRow":22,"startColumn":17,"endRow":22,"endColumn":20}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"1","currentFilePath":"/numbers.cpp","viewableBlogText":"    float num3 = 12.0; \n    float num4 = 2.0; \n    float result2; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-531":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-531","timestamp":1503779522386,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":531,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-530","lineNumber":27,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609183138169,"commentText":"The arithmetic operators for <font face=\"Courier\">floats</font> are the same as <font face=\"Courier\">ints</font> except there is no mod operator. <font face=\"Courier\">float</font> division results in numbers with fractional parts. In the case of the highlighted code the result is 6.0. Believe it or not <font face=\"Courier\">float</font> 6.0 is not the same as <font face=\"Courier\">int</font> 6. <font face=\"Courier\">ints</font> and <font face=\"Courier\">floats</font> are different from the computer's perspective. <br><div><br>Note: most compilers will attempt to coerce these to work together.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result2 = num3 / num4;","startRow":25,"startColumn":4,"endRow":25,"endColumn":26}],"imageURLs":["media/images/1607987199563-09.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    float num3 = 12.0; \n    float num4 = 2.0; \n    float result2; \n \n    result2 = num3 / num4; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-597":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-597","timestamp":1503779543223,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":597,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-596","lineNumber":31,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609183174011,"commentText":"Now if I change the value of the numerator from 12.0 to 13.0 and divide again I will get the more expected value of 6.5","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"num3 = 13.0;","startRow":27,"startColumn":4,"endRow":27,"endColumn":16},{"fileId":"fileId-0","selectedText":"result2 = num3 / num4;","startRow":29,"startColumn":4,"endRow":29,"endColumn":26}],"imageURLs":["media/images/1607987379901-10.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    num3 = 13.0; \n \n    result2 = num3 / num4; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-819":[{"id":"commentId-20","displayCommentEvent":{"id":"ev-819","timestamp":1607987624034,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":819,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-818","lineNumber":32,"column":28,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609183336515,"commentText":"There are some peculiarities with <font face=\"Courier\">floats</font> too, though. One would think that 10.0/3.0 would be 3.3 repeating. On a computer, though, it is not.<br><br>The issue is that there are an infinite number of 3's after the decimal point. But a <font face=\"Courier\">float</font> also has a size in memory that is not infinite. At some point there is not enough room for any more 3's.<div><br><font face=\"Courier\">floats</font> have a certain level of precision (or number of decimal places that can be held). This affects the acceptable values that can be stored in a <font face=\"Courier\">float</font>. Be careful when you are working with <font face=\"Courier\">floats</font>, often you will get results that are close, but not exactly, what a mathematician would give you. </div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"result2 = 10.0 / 3.0;","startRow":31,"startColumn":4,"endRow":31,"endColumn":25}],"imageURLs":["media/images/1607987436601-11.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/numbers.cpp","viewableBlogText":"    result2 = 10.0 / 3.0;  ","commentTags":[],"questionCommentData":{"allAnswers":["int","float"],"correctAnswer":"float","question":"Which data type would you use if you wanted a variable to store a student's grade point average?"}}]};
